import React from 'react';

const Welcome = () => {
    return (<>
        <section>
            <div className="container">
                <h2>Hey Name, Pick some course to continue</h2>
                <h2>Hey Name, Pick up where you left off..</h2>
                <h2>My Courses</h2>
            </div>
        </section>
    </>);
}

export default Welcome;
